import React, { useState } from 'react';
import axios from 'axios';

function HospitalList() {
    const [hospitalData, setHospitalData] = useState(null);

    const handleButtonClick = async () => {
        try {
            const response = await axios.get('http://localhost:3001/students');
            setHospitalData(response.data);
        } catch (error) {
            console.error('Error fetching hospital data:', error);
        }
    };

    return (
        <div>
            <h1>Hospital List</h1>
            <button onClick={handleButtonClick}>Fetch Hospital Data</button>
            {hospitalData ? (
                <ul>
                    {hospitalData.map((hospital) => (
                        <li key={hospital._id}>
                            <h2>{hospital.subject}</h2>
                            <p>Phone: {hospital.HospitalPhoneNo}</p>
                            <p>specialist: {hospital.specialist}</p>
                            <p> HospitalNoe: {hospital.HospitalNo}</p>
                        </li>
                    ))}
                </ul>
            ) : (
                <p>Click the button to fetch hospital data.</p>
            )}
        </div>
    );
}

export default HospitalList;
